Bekerja dengan Promises:

const fetchData = () => {
    return new Promise((resolve, reject) => {
        setTimeout(() => {
            resolve('Data loaded');
        }, 1000);
    });
};

fetchData()
    .then(data => console.log(data))
    .catch(error => console.error(error));

Sintaks async/await yang lebih clean:

async function loadData() {
    try {
        const response = await fetch('/api/data');
        const data = await response.json();
        console.log(data);
    } catch (error) {
        console.error('Error:', error);
    }
}

JSX adalah syntax extension untuk JavaScript:

const element = <h1>Hello, World!</h1>;

// Dengan expresi JavaScript
const name = 'John';
const element = <h1>Hello, {name}!</h1>;

// Multi-line JSX
const element = (
  <div>
    <h1>Title</h1>
    <p>Content</p>
  </div>
);

Functional component adalah cara modern membuat component:

function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

// Atau dengan arrow function
const Welcome = (props) => {
  return <h1>Hello, {props.name}</h1>;
};

// Menggunakan component
<Welcome name="Sara" />

Props adalah properties yang dikirim ke component:

function Card({ title, description, image }) {
  return (
    <div className="card">
      <img src={image} alt={title} />
      <h2>{title}</h2>
      <p>{description}</p>
    </div>
  );
}

// Menggunakan
<Card 
  title="React" 
  description="A JavaScript library"
  image="react.png"
/>

useState untuk mengelola state dalam functional component:

import { useState } from 'react';

function Counter() {
  const [count, setCount] = useState(0);

  return (
    <div>
      <p>Count: {count}</p>
      <button onClick={() => setCount(count + 1)}>
        Increment
      </button>
    </div>
  );
}

useEffect untuk side effects:

import { useEffect, useState } from 'react';

function DataFetcher() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/api/data')
      .then(res => res.json())
      .then(setData);

    // Cleanup function
    return () => {
      // Cleanup code
    };
  }, []); // Empty array = run once

  return <div>{data}</div>;
}

Membuat custom hooks untuk logic reusable:

function useLocalStorage(key, initialValue) {
  const [value, setValue] = useState(() => {
    const stored = localStorage.getItem(key);
    return stored ? JSON.parse(stored) : initialValue;
  });

  useEffect(() => {
    localStorage.setItem(key, JSON.stringify(value));
  }, [key, value]);

  return [value, setValue];
}

// Penggunaan
const [name, setName] = useLocalStorage('name', 'John');

